00;\n        display: none;\n      }\n\n      path.cell {\n        fill: none;\n        pointer-events: all;\n      }\n\n      circle {\n        fill: steelblue;\n        fill-opacity: .8;\n        stroke: #fff;\n      }\n\n      #cells.voronoi path.cell {\n        stroke: brown;\n      }\n\n      #cells g:hover path.arc {\n        display: inherit;\n      }\n    </style>\n  </head>\n  <body>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.csv.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.geo.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.geom.js\"><\/script>\n    <script>\n      var graph = $graph;\n      var w = $width;\n      var h = $height;\n\n      var linksByOrigin = {};\n      var countByAirport = {};\n      var locationByAirport = {};\n      var positions = [];\n\n      var projection = d3.geo.azimuthal()\n          .mode(\"equidistant\")\n          .origin([-98, 38])\n          .scale(1400)\n          .translate([640, 360]);\n\n      var path = d3.geo.path()\n          .projection(projection);\n\n      var svg = d3.select(\"body\")\n          .insert(\"svg:svg\", \"h2\")\n          .attr(\"width\", w)\n          .attr(\"height\", h);\n\n      var states = svg.append(\"svg:g\")\n          .attr(\"id\", \"states\");\n\n      var circles = svg.append(\"svg:g\")\n          .attr(\"id\", \"circles\");\n\n      var cells = svg.append(\"svg:g\")\n          .attr(\"id\", \"cells\");\n\n      var arc = d3.geo.greatArc()\n          .source(function(d) { return locationByAirport[d.source]; })\n          .target(function(d) { return locationByAirport[d.target]; });\n\n      d3.select(\"input[type=checkbox]\").on(\"change\", function() {\n        cells.classed(\"voronoi\", this.checked);\n      });\n\n      // Draw US map.\n      d3.json(\"https://mbostock.github.io/d3/talk/20111116/us-states.json\", function(collection) {\n        states.selectAll(\"path\")\n          .data(collection.features)\n          .enter().append(\"svg:path\")\n          .attr(\"d\", path);\n      });\n\n      // Parse links\n      graph.links.forEach(function(link) {\n        var origin = graph.nodes[link.source].name;\n        var destination = graph.nodes[link.target].name;\n\n        var links = linksByOrigin[origin] || (linksByOrigin[origin] = []);\n        links.push({ source: origin, target: destination });\n\n        countByAirport[origin] = (countByAirport[origin] || 0) + 1;\n        countByAirport[destination] = (countByAirport[destination] || 0) + 1;\n      });\n\n      d3.csv(\"https://mbostock.github.io/d3/talk/20111116/airports.csv\", function(data) {\n\n        // Build list of airports.\n        var airports = graph.nodes.map(function(node) {\n          return data.find(function(airport) {\n            if (airport.iata === node.name) {\n              var location = [+airport.longitude, +airport.latitude];\n              locationByAirport[airport.iata] = location;\n              positions.push(projection(location));\n\n              return true;\n            } else {\n              return false;\n            }\n          });\n        });\n\n        // Compute the Voronoi diagram of airports' projected positions.\n        var polygons = d3.geom.voronoi(positions);\n\n        var g = cells.selectAll(\"g\")\n            .data(airports)\n          .enter().append(\"svg:g\");\n\n        g.append(\"svg:path\")\n            .attr(\"class\", \"cell\")\n            .attr(\"d\", function(d, i) { return \"M\" + polygons[i].join(\"L\") + \"Z\"; })\n            .on(\"mouseover\", function(d, i) { d3.select(\"h2 span\").text(d.name); });\n\n        g.selectAll(\"path.arc\")\n            .data(function(d) { return linksByOrigin[d.iata] || []; })\n          .enter().append(\"svg:path\")\n            .attr(\"class\", \"arc\")\n            .attr(\"d\", function(d) { return path(arc(d)); });\n\n        circles.selectAll(\"circle\")\n            .data(airports)\n            .enter().append(\"svg:circle\")\n            .attr(\"cx\", function(d, i) { return positions[i][0]; })\n            .attr(\"cy\", function(d, i) { return positions[i][1]; })\n            .attr(\"r\", function(d, i) { return Math.sqrt(countByAirport[d.iata]); })\n            .sort(function(a, b) { return countByAirport[b.iata] - countByAirport[a.iata]; });\n      });\n    <\/script>\n  </body>\n</html>\"\"\")\n  }\n\n  def help() = {\ndisplayHTML(\"\"\"\n<p>\nProduces a force-directed graph given a collection of edges of the following form:</br>\n<tt><font color=\"#a71d5d\">case class</font> <font color=\"#795da3\">Edge</font>(<font color=\"#ed6a43\">src</font>: <font color=\"#a71d5d\">String</font>, <font color=\"#ed6a43\">dest</font>: <font color=\"#a71d5d\">String</font>, <font color=\"#ed6a43\">count</font>: <font color=\"#a71d5d\">Long</font>)</tt>\n</p>\n<p>Usage:<br/>\n<tt>%scala</tt></br>\n<tt><font color=\"#a71d5d\">import</font> <font color=\"#ed6a43\">d3._</font></tt><br/>\n<tt><font color=\"#795da3\">graphs.force</font>(</br>\n&nbsp;&nbsp;<font color=\"#ed6a43\">height</font> = <font color=\"#795da3\">500</font>,<br/>\n&nbsp;&nbsp;<font color=\"#ed6a43\">width</font> = <font color=\"#795da3\">500</font>,<br/>\n&nbsp;&nbsp;<font color=\"#ed6a43\">clicks</font>: <font color=\"#795da3\">Dataset</font>[<font color=\"#795da3\">Edge</font>])</tt>\n</p>\"\"\")\n  }\n}","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Warning: classes defined within packages cannot be redefined without a cluster restart.\nCompilation successful.\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"Command skipped","error":null,"workflows":[],"startTime":1506585369600,"submitTime":1506585369591,"finishTime":1506585370170,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width
